"""
Compute the number of ways to make a change of N with coins of given denominations.
N = 4; Coins = {1,2,3}
"""
def change(n, coins):
    m = len(coins)
    table = [[0 for x in range(m)] for x in range(n+1)]
    for i in range(m):
        table[0][i] = 1
    for i in range(1, n+1):
        for j in range(m):
            x = table[i - coins[j]][j] if i-coins[j] >= 0 else 0
            y = table[i][j-1] if j >= 1 else 0
            table[i][j] = x + y
    for i in range(1, n+1):
        for j in range(m):
            x = table[i - coins[j]][j] if i-coins[j] >= 0 else 0
            y = table[i][j-1] if j >= 1 else 0
            table[i][j] = x + y
    return table[n][m-1]

