import Foundation

func getValue(from json: [String: Any], key: String) -> Any? {
    if let value = json[key] {
        return value
    }

    for (_, value) in json {
        if let dictionary = value as? [String: Any] {
            if let result = getValue(from: dictionary, key: key) {
                return result
            }
        } else if let array = value as? [Any] {
            for item in array {
                if let dictionary = item as? [String: Any] {
                    if let result = getValue(from: dictionary, key: key) {
                        return result
                    }
                }
            }
        }
    }

    return nil
}

